package main

import "fmt"

func lengthOfLongestSubstring(s string) int {

	var m map[byte]bool = map[byte]bool{}

	mx := 0
	mxs := 0
	l := len(s)
	localMx := 0
	for i := 0; i < l; i++ {
		if _, ok := m[s[i]]; ok {
			m = map[byte]bool{}
			mx = max(mx, localMx)
			localMx = 0
			i, mxs = mxs, mxs+1
		} else {
			m[s[i]] = true
			localMx += 1
		}
	}

	mx = max(mx, localMx)

	return mx
}

func max(n1 int, n2 int) int {
	if n1 > n2 {
		return n1
	}
	return n2
}

